  const navigation = useNavigation();
  return (
    <>
      <MainNavigation></MainNavigation>
      <mai>
        {navigation.state === "loading" && <p>Loading ...</p>}
        <Outlet></Outlet>
      </mai>
    </>
  );
}

export default RootLayout;
